import React from "react";

const Cards = (props) => {
    return (
        <>
            <div class="card text-center h-100">
                <div className="overflow-auto"></div>
                <img
                    src={props.imgsrc}
                    class="card-img-top"
                    alt="..."
                />
                <div class="card-body text-dark">
                    <h5 class="card-title greenText fw-bold">{props.title}</h5>
                    <p class="card-text text-secondary">
                        {props.text}
                    </p>
                    <a href={props.link} target="_blank" className="btn btn-outline-dark stretched-link">Check Out</a>
                </div>
            </div>
        </>
    );
};

export default Cards;
